('2222','18','7797','Villa Sasse',Null,'Gepflegtes Endreihenhaus in Paguera zu vermieten','31494','\r\nDas Endreihenhaus liegt am Ortsrand von Paguera in ruhiger Wohnlage.\r\nDas Haus steht auf einem ca. 400m² großen Grundstück und die 180n² Wohn-Nutzfläche verteilt sich auf 2 ½  Etagen.\r\nIm EG befindet sich der Eingang  mit Diele, Küche, Hauswirtschaftsraum, Wohn-Esszimmer und überdachte Terrasse.\r\nIm 1. OG gibt es 2 Schlafzimmer, ein Galerie Schlafzimmer über 2 Etagen und 2 Badezimmer. Im 2. OG hat es ein Schlafzimmer mit  einer Sonnenterrasse.\r\nZur Ausstattung dieses gepflegten Reihenhauses gehören eine Ölzentralheizung, Holzfenster im EG und PVC Fenster im 1. OG. Ein schön angelegter mediterraner Garten und diverse Abstellräume schließen das Angebot ab.\r\n\r\n','31495','395000','106','2014-06-03 16:02:06','106','2014-06-03 16:02:42',Null,'2188','104','1032',1,'1','0',Null,Null,'miete','31496',Null,'0','0','0',Null,'2016-01-27 14:25:15',1,'0',Null,Null,Null,Null,'5',1,1,1,'0','1','1',1,1,Null,'31497',Null,'31498',Null,'31499',Null,'31500','626092841','31501','0',0,'5');
